// A component to display the list of goals
import React from 'react';
import Goal from './Goal';

const GoalList = ({ goalCategories, completeGoal }) => {
  return (
    <div>
      {goalCategories && Object.keys(goalCategories).map((category) => (
        <div key={category}>
          <h3>{category}</h3>
          {goalCategories[category].map((goal, index) => (
            <Goal key={index} goal={goal} completeGoal={completeGoal} />
          ))}
        </div>
      ))}
    </div>
  );
};

export default GoalList;
